int dist[LIMITDIJKSTRA+1][LIMITDIJKSTRA+1];
int ppai[LIMITDIJKSTRA+1][LIMITDIJKSTRA+1];

int dijkstra(vector<int> &componente)
{
	
	memset(dist, oo, sizeof dist);
	
	for(int x = 0; x < componente.size() ; x++)
	{
		int i = componente[x];
		
		queue<int> fila;
		dist[i][i] = 0;
		ppai[i][i] = i;
		fila.push(i);

		while(!fila.empty())
		{
			int u = fila.front(); fila.pop();

			for(int j = 0 ; j <(int)g[u].size(); j++)
			{
				int v = g[u][j];
				if(!binary_search(componente.begin(), componente.end(), v)) continue;
				if(vertices[v] && dist[i][v] > dist[i][u] + 1)
				{
					ppai[i][v] = u;
					dist[i][v] = dist[i][u] + 1;
					fila.push(v); 
				}
			}
		}
		
	}
	
	double maior = -1;
	int ans = componente[0];
	int inicio = componente[0], fim = componente[0];
	double somatorio = 0;
	for(int x = 0; x <(int)componente.size(); x++)
	{
		int i = componente[x];
		somatorio = 0;
		for(int y = 0; y <(int)componente.size(); y++)
		{
			int j = componente[y];
			
			if(dist[i][j] != oo)
			{

				somatorio+=dist[i][j];
			}
		}

		double centralidade = somatorio == 0 ? 1 : 1.0 / somatorio;
		
		if(centralidade > maior)
		{
			maior = centralidade;
			ans = i;
		}
	}

	return ans;
	/*
	vector<int> path;

	path.push_back(fim);
	int cur = fim;
	while(cur != inicio)
	{
		cur = ppai[inicio][cur];
		path.push_back(cur);
	}
	int meio = (path.size()-1)/2;
	return path[meio];
	*/
}


void dfs2(int u, int cur, vector<int> &componente)
{
	if(vis2[u] || !vertices[u]) return;
	vis2[u] = 1;
	cc[cur].push_back(u);
	for(int i = 0 ; i < g[u].size(); i++)
	{
		int v = g[u][i];
		if(!binary_search(componente.begin(), componente.end(), v)) continue;
		dfs2(v, cur, componente);
	}
}
int pai[N];
int depth(int u)
{
	memset(vis, -1, sizeof vis);

	queue<int>fila; fila.push(u);

	vis[u] = 0;
	pai[u] = 0;
	int ans = 0;
	while(!fila.empty())
	{
		int v = fila.front(); fila.pop();

		for(int i = 0 ; i < tree[v].size(); i++)
		{
			int w = tree[v][i];
			if(vis[w] == -1)
			{
				pai[w] = v;
				vis[w] = vis[v] + 1;
				ans = max(ans, vis[w]);
				fila.push(w);
			}
		} 
	}
	return ans;
}
